import React from 'react';
import Login from '../Login';

export const SignIn = ({ navigation }) => {
	return(
		<div id="SignIn">
			<button type="button" className="Button_Sign" onClick={() => navigation.next()}>Register</button>
			<Login/>
		</div>
	);
};
